export type Song = {
  SONG: string;
  ARTIST: string;
  ARTWORK: string;
  POINTS?: number;
  PLAYED_AT?: number;
};

export const searchSongs = (searchTerm: string): Song[] => {
  const filteredList = rock2000songs.filter(
    (song) =>
      song.SONG.toLowerCase().includes(searchTerm.toLowerCase()) ||
      song.ARTIST.toLowerCase().includes(searchTerm.toLowerCase())
  );
  return filteredList;
};

